  submit = (props) => {
    confirmAlert({
      title: '',
      message: 'Confirmer la suppression',
      buttons: [
        {
          label: 'oui',
          onClick: () => console.log(props.deleteUser(props.users))
        },
        {
          label: 'Non',
          onClick: () => console.log("blabla")
        }
      ]
    })
  }

  render() {
    return (
      <div className="container">
        <button onClick={this.submit}>X</button>
      </div>
    ); 
  }
}
